prepareRefImages.test:
it('should return undefined for invalid or missing method values', () => {
	assert.strictEqual(prepareRefImages(null, [], []), undefined);
	assert.strictEqual(prepareRefImages(undefined, [], []), undefined);
	assert.strictEqual(prepareRefImages('urls', null, []), undefined);
	assert.strictEqual(prepareRefImages('files', [], null), undefined);
});

it('should correctly process "urls" method with valid input', () => {
	const urls = [
		{ imageUrl: 'https://example.com/img1.jpg', tagImgUrl: 'One' },
		{ imageUrl: 'https://example.com/img2.jpg', tagImgUrl: 'Two' }
	];

	const expected = [
		{ uri: 'https://example.com/img1.jpg', tag: 'One' },
		{ uri: 'https://example.com/img2.jpg', tag: 'Two' }
	];

	assert.deepStrictEqual(prepareRefImages('urls', urls, []), expected);
});

it('should correctly process "files" method with valid input', () => {
	const fakeData1 = Buffer.from('hello');
	const base64one = fakeData1.toString('base64');

    const fakeData2 = Buffer.from('maker');
	const base64two = fakeData2.toString('base64');

	const files = [
		{ filename: 'image1.png', data: fakeData1, tagImgFile: 'FileTag1' },
        { filename: 'image2.jpeg', data: fakeData2, tagImgFile: 'FileTag2' }
	];

	const expected = [
		{
			uri: `data:image/png;base64,${base64one}`,
			tag: 'FileTag1'
		},
        {
			uri: `data:image/jpeg;base64,${base64two}`,
			tag: 'FileTag2'
		}
	];

	assert.deepStrictEqual(prepareRefImages('files', [], files), expected);
});

preparePromptImages.code:
function preparePromptImages(method, first, last) {
	const arr = [];
	switch (method) {
		case 'files':
			if (first?.data && first?.filename) arr.push({
				uri: `data:${iml.mime(first.filename)};base64,${first.data.toString('base64')}`,
				position: 'first'
			});
			if (last?.data && last?.filename) arr.push({
				uri: `data:${iml.mime(last.filename)};base64,${last.data.toString('base64')}`,
				position: 'last'
			});
			break;
		default: //? case 'url' or null to preserve behavior IEN-9500
			if (first) arr.push({ uri: first, position: 'first' })
			if (last) arr.push({ uri: last, position: 'last' })
			break;
	}
	return arr;
}

preparePromptImages.test:
it('should work with method === null to be backwards compatible', () => {
	const input = {
		uriInputMethod: null,
		imagePrompt: 'https://make.com',
		imagePromptLast: undefined
	};
	const output = [
		{
			uri: input.imagePrompt,
			position: 'first'
		}
	];

	assert.deepStrictEqual(preparePromptImages(input.uriInputMethod, input.imagePrompt, input.imagePromptLast), output);
});

it('should work with 2 URLs', () => {
	const input = {
		uriInputMethod: null,
		imagePrompt: 'https://make.com',
		imagePromptLast: 'https://make2.com'
	};
	const output = [
		{
			uri: input.imagePrompt,
			position: 'first'
		},
		{
			uri: input.imagePromptLast,
			position: 'last'
		}
	];

	assert.deepStrictEqual(preparePromptImages(input.uriInputMethod, input.imagePrompt, input.imagePromptLast), output);
});

it('should work with 1 or 2 files', () => {
	const input = {
		uriInputMethod: 'files',
		imagePrompt: {
			filename: 'test.jpeg',
			data: Buffer.from('123')
		},
		imagePromptLast: {
			filename: 'test2.jpeg',
			data: Buffer.from('456')
		}
	};
	const output = [
		{
			uri: 'data:image/jpeg;base64,MTIz',
			position: 'first'
		},
		{
			uri: 'data:image/jpeg;base64,NDU2',
			position: 'last'
		}
	];

	//? both:
	assert.deepStrictEqual(preparePromptImages(input.uriInputMethod, input.imagePrompt, input.imagePromptLast), output);
	//? only first:
	assert.deepStrictEqual(preparePromptImages(input.uriInputMethod, input.imagePrompt, null), [output[0]]);
	//? only last:
	assert.deepStrictEqual(preparePromptImages(input.uriInputMethod, null, input.imagePromptLast), [output[1]]);
});
